l = [1, 3, 5, 4, 7]
longest_length = 1
current_length = 1
for i in range(1, len(l)):
    if l[i] > l[i - 1]:
        current_length += 1
        longest_length = max(longest_length, current_length)
    else:
        current_length = 1
print("length of longest continuous increasing subsequence is ", longest_length)
